import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav style={styles.navbar}>
            <ul style={styles.navList}>
                <li style={styles.navItem}>
                    <Link to="/" style={styles.navLink}>Главная</Link>
                </li>
                <li style={styles.navItem}>
                    <Link to="/cart" style={styles.navLink}>Корзина</Link>
                </li>
                <li style={styles.navItem}>
                    <Link to="/about-us" style={styles.navLink}>О нас</Link> {/* Ссылка на страницу "О нас" */}
                </li>
            </ul>
        </nav>
    );
};

const styles = {
    navbar: {
        backgroundColor: '#333',
        padding: '10px',
    },
    navList: {
        display: 'flex',
        listStyleType: 'none',
        margin: 0,
        padding: 0,
    },
    navItem: {
        marginRight: '20px',
    },
    navLink: {
        color: 'white',
        textDecoration: 'none',
        fontSize: '18px',
    },
};

export default Navbar;
